import React from "react";

function PreparedBySelector({ value, setValue }) {
  const handleSelect = (selectedValue) => {
    setValue(selectedValue);
  };

  return (
    <div>
      <button
        onClick={() => handleSelect("Option 1")}
        className={value === "Option 1" ? "selected" : ""}
      >
        Option 1
      </button>
      <button
        onClick={() => handleSelect("Option 2")}
        className={value === "Option 2" ? "selected" : ""}
      >
        Option 2
      </button>
    </div>
  );
}

export default PreparedBySelector;
